##   expected: ['kzxwqegknd']
##
##   TestCase 3:
##   input: ["michmznaitnjdnjkdsnmichmznait","michmznait"]
##   expected: ['michmznait']
##
##   TestCase 4:
##   input: ["afgegrwgwga","aa"]
##   expected: ['afgegrwgwga']
##
##   TestCase 5:
##   input: ["abcdbebe","bbe"]
##   expected: ['bcdbe','bebe']
##
