##   input: ["akdjfiebcdeafgbhcdefagbcdef","abcd"]
##   expected: ['agbcd']
##   
##   expected_outputs: ['bcde', 'kzxwqegknd', 'michmznait', 'afgegrwgwga', 'bcdbe', 'agbcd']
##
##   more_inputs: [['abcdedeaqdweq', 'adeq'], ['fgrqsqsnodwmxzkzxwqegkndaa', 'kzed'], ['zxcvnhss', 'css'], ['alpha', 'la'], ['beta', 'ab']]
##   expected_outputs: ['aqdweq', 'kzxwqegknd', 'cvnhss', 'lpha', '']  
