import unittest
from minimum_window_subsequence import min_window

class TestMinimumWindowSubsequence(unittest.TestCase):
    def test_case_1(self):
        inputs = ["abcdebdde","bde"]
        expected = "bcde"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_2(self):
        inputs = ["fgrqsqsnodwmxzkzxwqegkndaa","kzed"]
        expected = "kzxwqegknd"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_3(self):
        inputs = ["michmznaitnjdnjkdsnmichmznait","michmznait"]
        expected = "michmznait"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_4(self):
        inputs = ["afgegrwgwga","aa"]
        expected = "afgegrwgwga"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_5(self):
        inputs = ["abcdbebe","bbe"]
        expected = "bebe"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_6(self):
        inputs = ["akdjfiebcdeafgbhcdefagbcdef","abcd"]
        expected = "agbcd"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_7(self):
        inputs = []
        # let's uncomment the following test case and see how the code times out
        # inputs = ""
        inputs.append("ffffffffeeeeeeeessssssssa")
        inputs.append("fffessa")
        expected = "fffeeeeeeeessssssssa"
        self.assertEqual(min_window(*inputs),expected)
    def test_case_8(self):
        inputs = ['abcdedeaqdweq', 'adeq']
        expected = 'aqdweq'
        self.assertEqual(min_window(*inputs),expected)
    def test_case_9(self):
        inputs = ['fgrqsqsnodwmxzkzxwqegkndaa', 'kzed']
        expected = 'kzxwqegknd'
        self.assertEqual(min_window(*inputs),expected)
    def test_case_10(self):
        inputs = ['zxcvnhss', 'css']
        expected = 'cvnhss'
        self.assertEqual(min_window(*inputs),expected)
    def test_case_11(self):
        inputs = ['alpha', 'la']
        expected = 'lpha'
        self.assertEqual(min_window(*inputs),expected)
    def test_case_12(self):
        inputs = ['beta', 'ab']
        expected = ''
        self.assertEqual(min_window(*inputs),expected)
if __name__ == '__main__':
    unittest.main(verbosity=2)
